pragma solidity ^0.8.18;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract MetaKAKI is Ownable(msg.sender) {
    using SafeMath for uint256;
    bytes32 public name = "MetaKAKI"; // Convert string to bytes32
    bytes32 public symbol = "MTK";     // Convert string to bytes32
    uint8 public decimals = 18;
    uint256 public totalSupply = 1000000000000 ether;

    uint256 public constant burnInterval = 2 * 365 days; // 2 years in seconds
    uint256 public constant maxBurnPercent = 10;
    uint256 public lastBurnTimestamp;
    uint256 public remainingSupply;

    uint256 public buyingFeePercent = 8; // 0.08%
    uint256 public sellingFeePercent = 25; // 0.25%

    address public feeReceiver = 0xBEcb325100DbD4CDbe02Dc584Ec146ab1AC739eC; // Address to receive fees

    uint256 public maxBuyPercentPerWallet = 8; // 8% (8 * 100)
    uint256 public maxSellPercentPerWallet = 450; // 4.5% (4.5 * 100)
    uint256 public sellCooldown = 3 days;

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    mapping(address => uint256) public lastSellTimestamp;

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Burn(address indexed from, uint256 value);

    constructor () {
        balanceOf[msg.sender] = totalSupply;
        remainingSupply = totalSupply;
        lastBurnTimestamp = block.timestamp;
    }

    function transfer(address to, uint256 value) public returns (bool) {
        require(to != address(0), "Invalid address");
        require(balanceOf[msg.sender] >= value, "Insufficient balance");

        uint256 fee = value.mul(sellingFeePercent).div(10000); // Calculate the fee (0.25% of the value)
        uint256 receivedAmount = value.sub(fee); // Calculate the amount after the fee

        balanceOf[msg.sender] = balanceOf[msg.sender].sub(value);
        balanceOf[to] = balanceOf[to].add(receivedAmount);

        // Send the fee to the feeReceiver address
        balanceOf[feeReceiver] = balanceOf[feeReceiver].add(fee);

        // Update the last sell timestamp
        lastSellTimestamp[msg.sender] = block.timestamp;

        emit Transfer(msg.sender, to, receivedAmount);
        emit Transfer(msg.sender, feeReceiver, fee);

        return true;
    }

    function approve(address spender, uint256 value) public returns (bool) {
        allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) public returns (bool) {
        require(from != address(0), "Invalid address");
        require(to != address(0), "Invalid address");
        require(balanceOf[from] >= value, "Insufficient balance");
        require(allowance[from][msg.sender] >= value, "Allowance exceeded");

        uint256 fee = value.mul(sellingFeePercent).div(10000); // Calculate the fee (0.25% of the value)
        uint256 receivedAmount = value.sub(fee); // Calculate the amount after the fee

        balanceOf[from] = balanceOf[from].sub(value);
        balanceOf[to] = balanceOf[to].add(receivedAmount);

        // Send the fee to the feeReceiver address
        balanceOf[feeReceiver] = balanceOf[feeReceiver].add(fee);

        // Update the allowance
        allowance[from][msg.sender] = allowance[from][msg.sender].sub(value);

        // Update the last sell timestamp
        lastSellTimestamp[from] = block.timestamp;

        emit Transfer(from, to, receivedAmount);
        emit Transfer(from, feeReceiver, fee);

        return true;
    }

    function burn(uint256 value) public onlyOwner {
        require(block.timestamp >= lastBurnTimestamp.add(burnInterval), "Burn interval not reached yet");
        uint256 maxBurnAmount = remainingSupply.mul(maxBurnPercent).div(100);
        require(value <= maxBurnAmount, "Burn amount exceeds the allowed limit");
        require(value <= remainingSupply, "Burn amount exceeds the remaining supply");

        balanceOf[msg.sender] = balanceOf[msg.sender].sub(value);
        remainingSupply = remainingSupply.sub(value);

        emit Burn(msg.sender, value);
        lastBurnTimestamp = block.timestamp;
    }

    function setBuyingFee(uint256 _feePercent) public onlyOwner {
        buyingFeePercent = _feePercent;
    }

    function setSellingFee(uint256 _feePercent) public onlyOwner {
        sellingFeePercent = _feePercent;
    }

    function setMaxBuyPercentPerWallet(uint256 _percent) public onlyOwner {
        maxBuyPercentPerWallet = _percent;
    }

    function setMaxSellPercentPerWallet(uint256 _percent) public onlyOwner {
        maxSellPercentPerWallet = _percent;
    }

    function setSellCooldown(uint256 _cooldown) public onlyOwner {
        sellCooldown = _cooldown;
    }

    function setFeeReceiver(address _feeReceiver) public onlyOwner {
        feeReceiver = _feeReceiver;
    }
}
"
